import React from 'react'
import './App.css';

const BlockButton = ({ onClick, label, style, customContent, children }) => {

  const renderCustom = customContent
  const renderDefault = (
    <div 
      className="block-button"
      style={style}
      onClick={onClick}>
      <label>{label}</label>
    </div>
  )

  return (
    <div 
      className="block-button"
      style={style}
      onClick={onClick}>
      { children ? children : <label>{label}</label> }
    </div>
  )
}

export default BlockButton;
